Text:
Эндиликда божхона органларига юборилаётган божхона юк декларацияларини тўлдириш билан шуғулланувчи божхона брокери фаолиятини амалга оширувчи ташкилотлар бир қанча талабларга жавоб бериши лозим бўлади. Жумладан:
- БҲМнинг минг баравари (ҳозирда 375 млн сўм) миқдорида божхона тўловлари тўланиши таъминланганлиги (депозит, суғурта ва ҳ.з)
- штатида икки ва ундан ортиқ божхона расмийлаштируви бўйич мутахассислар (ходим) бўлиши ва ушбу ходимлар ҳар икки йилда малака оширганлик тўғрисидаги сертификатга эга бўлиши;
